import React from "react";
import "bootstrap/dist/css/bootstrap.css";

const Movies = (props) => {
  const { data } = props;

  return (
    <div>
      <h5>{data.length}</h5>
      {data.map((m) => {
        return <list key={m.id}>{m.title}</list>;
      })}
    </div>
  );
};

export default Movies;
